Prefatory;
Encouraged by a thoughtful, and careful mother to collect Ethnological specimens, a considerable accumulation of valuable Indian relics have been gotten together, and because of their perishable nature, and the uncertain tenure of all mundain things, the author has employed himself for some? years in getting together authentic data, connected with the Ethnology of the American indians, and making drawings of the specimens in his own collection, and those of his friends, and acquaintances possessed of valuable specimens, in order to perpetuate, and hand down to posterity a true portrait of the indian of today, at least as much of the native indian as at present exists. The motive which prompts this work is the desire to assert in its rapid destination the indian characteristic, and put the generation yet to come in possession of facts in picture and word, of the fast disappearing aboriginal race, who from the landing of Columbus, to the present day has been receding before the march of the white man. To day; surrounded by the main? bands of the white civilization, the indian; as wild, untutored, and free footed savage is doomed, a single decade race with his heirs? run?.Convinced of this the author has made excursions into the indian country, lived in their villages, and with note book, pencil & camera watched, talked with and studied them in order to glean the fragments, which have been put in to this mosaic. "Books after all are but mosaics. The words as stones which when artistically joined form unclear a work of beauty.
